import Todo from "./Todo/Todo";

const TodoList = ({toDoList, handleToggle, handleFilter}) => {

  return (
      <div>
        {toDoList.map(todo => {
          return (
              <Todo todo={todo} handleToggle={handleToggle} handleFilter={handleFilter}/>
          );
        })}

      </div>
  );
};

export default TodoList;
